Dune (2000)
TV Mini-Series - 265 min - Adventure | Drama | Fantasy

In the 11th millennium, Shaddam IV, ruler of the Galactic Empire, rids himself of his competitor Duke Leto Atreides by giving him control of the desert planet Dune also called Arrakis; fully aware that its present owner, Baron Vladimir Harkonnen, will not give it up without a fight. The reason is that Arrakis is the source of the valuable spice, a substance produced by enormous and dangerous sandworms, which bestows special mental qualities on anyone who consumes it. A short while later Harkonnen does indeed succeed in ambushing and massacring Leto and his men. Leto's mistress Lady Jessica, who is a member of the clairvoyant order of Bene Gesserit, manages to escape into the desert with her son Paul, and after a long and dangerous march they finally encounter the Fremen, the long suppressed desert tribe of Arrakis. Impressed by Paul's clairvoyant abilities, tribal prince Stilgar takes in the fugitives. Very soon the Fremen are convinced that Paul is their long-prophesied redeemer, and...

Stars: William Hurt, Alec Newman, Giancarlo Giannini

